// UofTResources.js
import React from 'react';

function UofTResources() {
  return (
    <div className='resources'>
      <header>
        <nav>
          <ul>
            <li><a href="/">HOME</a></li>
          </ul>
        </nav>
      </header>
      <p>
        I figure it's best to have as much information for everyone to learn from for free...
      </p>
      <h2>These sites are for Computer Science</h2>
      <hr />
      {/* Add links similarly as in your HTML */}
      <a href="https://mcs.utm.utoronto.ca/~108s21/index.html" target="_blank">
        CSC108 (Intro to Computer Programming)
      </a>
      {/* Add more links here */}
    </div>
  );
}

export default UofTResources;


function Projects() {
  return (
    <div className="projects">
      {/* Contents of the Projects section */}
      <h1>Projects</h1>
      <p>This is the Projects section.</p>
    </div>
  );
}
